export default function Table(props){
    return(
        <>
            <table className="table">
                <thead>
                    <th>Name</th>
                    <th>Email</th>
                    <th>Phone</th>
                </thead>
                <tbody>
                    {props.props.map((val,i)=>{
                        return( 
                            <tr key={i}>
                                <td>{val.Name}</td>
                                <td>{val.Email}</td>
                                <td>{val.Phone}</td>
                            </tr>
                        );
                    })}
                </tbody>
            </table>
        </>
    )
}
